column1:
Kultuuriministri määruste eelnõud:
1) Üld- ja detailplaneeringu muinsuskaitse eritingimuste koostamise kord;
2) Kinnismälestise ja muinsuskaitsealal paikneva ehitise muinsuskaitse eritingimuste koostamise kord;
3) Muinsuskaitselise järelevalve kord ning ehitus- ja muu töö dokumenteerimise kord;
4) Veealusele mälestisele sukeldumise loa väljaandmise, sukeldumisest teavitamise ja veealuse mälestise ning selle kaitsevööndi seisundist teavitamise kord, veealusele mälestisele sukeldumise loa vorm.

VV korralduste eelnõu: Aruanne valdkondliku arengukava „Eesti lõimumiskava 2008–2013“ rakendusplaani täitmise kohta 2010. aastal;
„Eesti lõimumiskava 2008–2013“ rakendusplaan aastateks  2011–2013 ja
„Eesti lõimumiskava 2008–2013“ rakendusplaan aastaks 2011.
